import './App.css';
import {BrowserRouter , Route ,Routes} from 'react-router-dom';
import Login from './components/login';

import CourseView from './components/course';
import RunningCourse from './components/running';
import InstructorView from './components/instructor';
function App() {
  return (
    <div className="App">
        <div className="container">
          <BrowserRouter>
            <Routes>
              <Route path='/login' element={<Login/>}/>
              <Route path='/home' element={<Home/>}/>
              <Route path='/instructor/:instructorId'element={<InstructorView/>}/>
              <Route path='/course/running' element={<RunningCourse/>}/>
              <Route path='/course/running/:deptName' element={<RunningCourse/>}/>
              <Route path='/course/:courseId' element={<CourseView/>}/>
            </Routes>
          </BrowserRouter>
        </div>
    </div>
  );
}

export default App;
